import React from 'react'

const Product = (product) => {

    const prod = product.product;
    const printProd = () => {
        prod.productCategory && 
        console.log(prod.productCategory?.category)
    }

    return (
        <>
        <div>
            <button onClick={printProd}>Print </button>
              <p><span>Name : {prod.productName} </span></p> 
           <span>Price :  <p>{prod.productPrice}</p></span>
            <span>Quantity :   <p>{prod.productQty} </p>  </span>
            <span>Description :  <p>{prod.productDescription} </p></span>
            <span>Category :  <p>{prod.productCategory?.category}</p></span>
           <hr />
        </div>
    </>
    )
}

export default Product
